            _router // eth -> 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D
        );
        // Create a Dex pair for this new token
        address _DexV2Pair = IDexV2Factory(
            _DexV2Router.factory()
        ).createPair(address(this), _DexV2Router.WETH());

        DexV2Router = _DexV2Router;
        DexV2Pair = _DexV2Pair;

        _setAutomatedMarketMakerPair(_DexV2Pair, true);
        dividendTracker.excludeFromDividends(address(_DexV2Router));
    } 

    function setInitalSellFeeDuration(
        uint256 _duration
    ) external onlyOwner {
        initalSellFeeDuration = _duration;
