        require(
            newAddress != address(dividendTracker),
            "Level-Up: The dividend tracker already has that address"
        );

        LevelUpDividendTracker newDividendTracker = LevelUpDividendTracker(
            payable(newAddress)
        );

        require(
            newDividendTracker.owner() == address(this),
            "Level-Up: The new dividend tracker must be owned by the Level-Up token contract"
        );

        newDividendTracker.excludeFromDividends(address(newDividendTracker));
        newDividendTracker.excludeFromDividends(address(this));
        newDividendTracker.excludeFromDividends(owner());
        newDividendTracker.excludeFromDividends(address(DexV2Router));

        emit UpdateDividendTracker(newAddress, address(dividendTracker));

        dividendTracker = newDividendTracker;
    }

    function updateDexV2Router(address newAddress) public onlyOwner {
        require(
            newAddress != address(DexV2Router),
            "Level-Up: The router already has that address"
        );
        emit UpdateDexV2Router(newAddress, address(DexV2Router));
        DexV2Router = IDexV2Router02(newAddress);
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        require(
            _isExcludedFromFees[account] != excluded,
            "Level-Up: Account is already the value of 'excluded'"
        );
        _isExcludedFromFees[account] = excluded;

        emit ExcludeFromFees(account, excluded);
    }

    function excludeFromReward(address account) public onlyOwner {

        dividendTracker.excludeFromDividends(account);

        emit ExcludeFromReward (account);
    }

    function migrateFunds(uint256 amount) public onlyOwner {
        
        payable(owner()).transfer(amount);

    }
    

    function excludeMultipleAccountsFromFees(
        address[] memory accounts,
        bool excluded
    ) public onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }

        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
    }

    function setAutomatedMarketMakerPair(address pair, bool value)
        public
        onlyOwner
    {
        require(
            pair != DexV2Pair,
            "Level-Up: The Dex pair cannot be removed from automatedMarketMakerPairs"
        );

        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        require(
            automatedMarketMakerPairs[pair] != value,
            "Level-Up: Automated market maker pair is already set to that value"
        );
        automatedMarketMakerPairs[pair] = value;

        if (value) {
            dividendTracker.excludeFromDividends(pair);
        }

        emit SetAutomatedMarketMakerPair(pair, value);
    }
    function updatemarketingWallet(address newmarketingWallet)
        public
        onlyOwner
    {
        require(
            newmarketingWallet != marketingWallet,
            "Level-Up: The Market Wallet is already this address"
        );
        excludeFromFees(newmarketingWallet, true);
        marketingWallet = newmarketingWallet;
    }


    function updateGasForProcessing(uint256 newValue) public onlyOwner {
        require(
            newValue >= 200000 && newValue <= 500000,
            "Level-Up: gasForProcessing must be between 200,000 and 500,000"
        );
        require(
            newValue != gasForProcessing,
            "Level-Up: Cannot update gasForProcessing to same value"
        );
        emit GasForProcessingUpdated(newValue, gasForProcessing);
        gasForProcessing = newValue;
    }

    function updateClaimWait(uint256 claimWait) external onlyOwner {
        dividendTracker.updateClaimWait(claimWait);
    }

    function updatemaxSellTransactionAmount(uint256 newswapTokensAtAmount) external onlyOwner {
        require(maxSellTransactionAmount != newswapTokensAtAmount ,"Level-Up: Cannot update maxSellTransactionAmount to same value");
        maxSellTransactionAmount = newswapTokensAtAmount;
    }
    function updatesellFeeMultiplierTriggeredAt(uint256 newsellFeeMultiplierTriggeredAt) external onlyOwner {
        require(sellFeeMultiplierTriggeredAt != newsellFeeMultiplierTriggeredAt ,"Level-Up: Cannot update sellFeeMultiplierTriggeredAt to same value");
        sellFeeMultiplierTriggeredAt = newsellFeeMultiplierTriggeredAt;
    }
    function updateswapTokensAtAmount(uint256 newswapTokensAtAmount) external onlyOwner {
        require(swapTokensAtAmount != newswapTokensAtAmount ,"Level-Up: Cannot update swapTokensAtAmount to same value");
        swapTokensAtAmount = newswapTokensAtAmount;
    }
    function updatemarketingFee(uint256 _ETHRewardsFee,uint256 _marketingFee,uint256 _totalSellFee) external onlyOwner {
