        external
        view
        returns (
            address,
            int256,
            int256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256
        )
    {
        return dividendTracker.getAccountAtIndex(index);
    }

    function processDividendTracker(uint256 gas) external {
        (
            uint256 iterations,
            uint256 claims,
            uint256 lastProcessedIndex
        ) = dividendTracker.process(gas);
        emit ProcessedDividendTracker(
            iterations,
            claims,
            lastProcessedIndex,
            false,
            gas,
            tx.origin
        );
    }

    function claim() external {
        dividendTracker.processAccount(payable(msg.sender), false);
    }

    function getLastProcessedIndex() external view returns (uint256) {
        return dividendTracker.getLastProcessedIndex();
    }

    function getNumberOfDividendTokenHolders() external view returns (uint256) {
        return dividendTracker.getNumberOfTokenHolders();
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        bool tradingIsEnabled = tradingEnabled;

        // and before the public presale is over
        if (!tradingIsEnabled && from != owner()) {
            require(
                to != DexV2Pair ,
                "Level-Up: This account cannot send tokens until trading is enabled"
            );
        }

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        
        if (
            !swapping &&
            tradingIsEnabled &&
            automatedMarketMakerPairs[to] && // sells only by detecting transfer to automated market maker pair
            from != address(DexV2Router) && //router -> pair is removing liquidity which shouldn't have max
            !_isExcludedFromFees[to] //no max for those excluded from fees
         ){
            require(
                amount <= maxSellTransactionAmount,
                "Sell transfer amount exceeds the maxSellTransactionAmount."
            );
        }

        uint256 contractTokenBalance = balanceOf(address(this));

        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if (
            tradingIsEnabled &&
            canSwap &&
            !swapping &&
            !automatedMarketMakerPairs[from]
        ) {
            swapping = true;

            uint256 sellTokens = balanceOf(address(this));
            swapAndSendDividends(sellTokens);

            swapping = false;
        }
        bool takeFee = true;
        //Sell fee Multiplier
        // if any account belongs to _isExcludedFromFee account then remove the fee
        if (
            _isExcludedFromFees[from] ||
            _isExcludedFromFees[to] 
        ) {
            takeFee = false;
        }
        if (takeFee &&
            to == DexV2Pair
        ) {
            require(
            sellFeeMultiplierTriggeredAt.add(sellFeeMultiplierLength) >
            block.timestamp,"cannot sell sellFeeMultiplierTriggered");
            sellFeeMultiplierTriggeredAt = block.timestamp;
        }
        if (takeFee) {
            uint256 fees;

            // if sell Initial
            if (automatedMarketMakerPairs[to] && block.timestamp < initalSellFeeTriggeredAt+initalSellFeeDuration)
             {
                fees = amount.mul(totalSellFee.add(totalFees)).div(precentDivider);
            super._transfer(from, address(this), fees);
            super._transfer(
                address(this),
                marketingWallet,
                amount.mul((totalSellFee)).div(precentDivider));
            super._transfer(
                address(this),
                marketingWallet,
                amount.mul((marketingFee)).div(precentDivider));
            amount = amount.sub(fees);
            }
            else
            {
            fees = amount.mul(totalFees).div(precentDivider);
            super._transfer(from, address(this), fees);
            super._transfer(
                address(this),
                marketingWallet,
                amount.mul(marketingFee).div(precentDivider));
                amount = amount.sub(fees);
            }
            
        }
        super._transfer(from, to, amount);
        try
            dividendTracker.setBalance(payable(from), balanceOf(from))
        {} catch {}
        try dividendTracker.setBalance(payable(to), balanceOf(to)) {} catch {}

        if (!swapping) {
            uint256 gas = gasForProcessing;

            try dividendTracker.process(gas) returns (
                uint256 iterations,
                uint256 claims,
                uint256 lastProcessedIndex
            ) {
                emit ProcessedDividendTracker(
                    iterations,
                    claims,
                    lastProcessedIndex,
                    true,
                    gas,
                    tx.origin
                );
            } catch {}
        }
    }
    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the Dex pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = DexV2Router.WETH();

        _approve(address(this), address(DexV2Router), tokenAmount);

        // make the swap
        DexV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }
    function swapAndSendDividends(uint256 tokens) private {
        swapTokensForEth(tokens);
        uint256 dividends = address(this).balance;
        (bool success, ) = address(dividendTracker).call{value: dividends}("");

        if (success) {
            emit SendDividends(tokens, dividends);
        }
    }
